function onAssignButtonClicked(){var n=$(this).attr("data-investmend-id");ajaxAssignInvestment(n)}function onAjaxInvestmentAssignCompleted(n){var t=$('tr[data-investment-id="'+n.toString()+'"]');$("td > div > button#Assign",t).hide();$("td > div > a#Assigned",t).show()}function onAjaxInvestmentAssignFailed(){alert("Wystąpił problem z przypisaniem inspektora. Proszę odświeżyć stronę i powtórzyć działanie jeśli to nie pomoże, proszę skontaktowac się z administratorem.")}function ajaxAssignInvestment(n){var t=$.ajax({type:"POST",url:"/Investments/AssignInspector",data:{InspectorId:null,InvestmentId:n},dataType:"html"});t.done(function(t,i){onAjaxInvestmentAssignCompleted(n,i)});t.fail(function(n,t,i){onAjaxInvestmentAssignFailed(n,t,i)})}$("body").on("click",".investment-assign",onAssignButtonClicked);